def obter_numero(mensagem):
    while True:
        try:
            return float(input(mensagem))
        except ValueError:
            print("Por favor, insira um n√∫mero v√°lido.")

def mostrar_soma(num1, num2):
    return num1 + num2

def mostrar_resto(num1, num2):
    return num1 - num2

def mostrar_multiplicacao(num1, num2):
    return num1 * num2

def exibir_menu():
    return """
    Menu:
    1. Mostrar a soma dos dois n√∫meros
    2. Mostrar o resto dos dois n√∫meros (o primeiro menos o segundo)
    3. Mostrar a multiplica√ß√£o dos dois n√∫meros
    0. Sair
    """

def opcao_invalida():
    print("Op√ß√£o inv√°lida. Tente novamente.")

def sair_programa():
    print("Saindo do programa. At√© mais!")

# Mapeamento das escolhas para as fun√ß√µes correspondentes
opcoes = {
    1: mostrar_soma,
    2: mostrar_resto,
    3: mostrar_multiplicacao,
    0: sair_programa,
}

def main():
    while True:
        try:
            num1 = obter_numero("Digite o primeiro n√∫mero: ")
            num2 = obter_numero("Digite o segundo n√∫mero: ")

            print(exibir_menu())

            escolha = int(input("Escolha uma op√ß√£o: "))

            if escolha in opcoes:
                resultado = opcoes[escolha](num1, num2)
                if escolha != 0:
                    print(f"Resultado: {resultado}")
                else:
                    opcoes[escolha]()
                    break
            else:
                opcao_invalida()

        except ValueError:
            print("Por favor, insira n√∫meros v√°lidos.")

if __name__ == "__main__":
    main()

